import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

import './App.css';
import ToDoPage from './Pages/ToDoPage';
import showPage from './Pages/showPage';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/'>
            <ToDoPage />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
